/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` varchar(32) CHARACTER SET utf8mb4 NOT NULL COMMENT '主键',
  `username` varchar(30) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '账号',
  `password` varchar(33) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '密码',
  `realname` varchar(30) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '真实姓名',
  `nickname` varchar(60) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '昵称',
  `avatar` varchar(30) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '头像',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `gender` tinyint(1) unsigned DEFAULT '0' COMMENT '性别，0保密（默认），1男，2女',
  `email` varchar(90) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '邮箱',
  `mobile` varchar(11) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '手机号',
  `role_id` text COMMENT '角色ID数组，逗号隔开',
  `phone` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '座机号',
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '账号状态，1：启用，2：冻结 3：删除',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `office_id` varchar(32) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '机构id',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统用户表';

